import React, { Component } from "react";

class Title extends Component {
  constructor() {
    super();
    this.array = [1, 2, 3, 4];
    this.objeto = [
      {
        id: 1,
        nombre: "Carlos",
      },

      {
        id: 2,
        nombre: "Ariel",
      },

      {
        id: 1,
        nombre: "Kendall",
      },
    ];
  }
  render() {
    return <p className="P">{this.array}</p>;
  }
}

export default Title;
